import { List } from "./List";
import { Form } from "./Form";

export const Todo = () => {
  const todosList = [
    {
      id: 1,
      content: "店予約する",
    },
    {
      id: 2,
      content: "卵買う",
    },
    {
      id: 3,
      content: "郵便出す",
    },
  ];


  return (
    <>

      <ul>
        {todosList.map((todo) => {
          return (
            <>
              <button >完了</button>
              <li key={todo.id}>{todo.content}</li>
            </>
          )
        })}
      </ul>
    </>
  );
};
